INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, 110501, "2019/07/31 12:00:00", 24015, 4, 0.0, 4, 24, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 1, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 4.0, 110501, "2019/07/31 12:00:00", 24016, 1, 0.0, 4, 24, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 2, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, 110501, "2019/07/31 12:00:00", 24017, 4, 0.0, 4, 24, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 3, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 5.2, 110501, "2019/07/31 12:00:00", 24018, 2, 0.0, 1, 24, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 4, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 4.2, 110501, "2019/07/31 12:00:00", 24019, 6, 0.0, 5, 24, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, 110501, "2019/07/31 12:00:00", 24020, 2, 0.0, 2, 24, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 6, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 6.4, 110501, "2019/07/31 12:00:00", 24021, 6, 0.0, 1, 24, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 7, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, 110501, "2019/07/31 12:00:00", 24022, 2, 0.0, 2, 24, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 8, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 10.08, 110501, "2019/07/31 12:00:00", 24023, 3, 0.0, 6, 24, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 9, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 5.0, 110501, "2019/07/31 12:00:00", 24024, 2, 0.0, 1, 24, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10, "カオリ（サマー）", 10021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, 110501, "2019/07/31 12:00:00", 24025, 2, 0.0, 2, 24, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 11, "カオリ（サマー）", 10021);
